import Navbar from "../components/Navbar.js";

function Email(){
  return(
    <div className = "row">
      <div className = "col-md-3">
        <Navbar/>
      </div>
      <div className = "col-md-9">
        <h1>Email</h1>
      </div>
    </div>
  )
}

export default Email;
